import React from 'react'
import StreamItems from './StreamItems'

const flex = {
  display: 'flex', 
  justifyContent: 'space-between'
}

const StreamList = (props) => {
  const { streams } = props
  return (
    <ul class="collection with-header">
      <li class="collection-header"><div style={flex}><h5>Streams</h5> <i className='small material-icons' style={{color: 'gray', marginTop: '10px'}}>add</i> </div></li>
      {
        streams.map(stream => (<StreamItems stream={stream} />))
      }
    </ul>  
  )
}

export default StreamList
